(1) mixed data type int a = 2;
float b = 2.0;
int c = a + b;
float d = a + b; Since a and b have different data types, C complier will do data type casting for c and d. This is not suggested. Solution: Make a and b the same data type. float a = 2.0;
float b = 2.0;
int c = a + b; int a = 2;
int b = 2;
int c = a + b;
